import React from "react";
import "./Checkoutdescription.css"



const Checkoutdescription = () => {
    return (
        <div className="comdes">
            <p>Description</p>
            <p>The most powerful MacBook Pro ever is here. With the blazing-fast M1 Pro or M1 Max <p>chip — the first Apple silicon designed for pros — you get groundbreaking performance </p>
            <p>and amazing battery life. Add to that a stunning Liquid Retina XDR display, the best</p> camera and audio ever in a Mac notebook, and all the ports you need. The first notebook of its kind, this MacBook Pro is a beast. M1 Pro takes the exceptional performance of the M1 architecture to a whole new level for pro users.</p>
        <p>Even the most ambitious projects are easily handled with up to 10 CPU cores, up to 16 GPU cores, a 16‑core Neural Engine, and dedicated encode and decode media engines that support H.264, HEVC, and ProRes codecs.</p>
        </div>
    )

}
export default  Checkoutdescription
